import React from "react";

import { Link } from 'react-router-dom'

import Business_icon from '../../1_image_or_icon/cooking-chef-cap-icon.png'

export const Registration_Default_Page = () => {

    return <React.Fragment>
    
    <div
    style={{
    width:'inherit',
    height:'inherit',
    
    display:'flex',
    flexDirection:'row',

    justifyContent:'center',
    alignItems: 'center'
    }}
    >

        <div
        style={{
        display:'flex',
        flexDirection:'row'
        }}
        >

            <span>
                <div
                className="Registration_btn"
                >
                    <img
                    src= {Business_icon}
                    style={{
                    width: '15vw'
                    }}
                    ></img>
                    <span>
                    Create Account <br></br> For Business
                    </span>
                </div>


            </span>

            <span>
                <div
                className="Registration_btn"
                >
                    <img
                    src= {Business_icon}
                    style={{
                    width: '15vw'
                    }}
                    ></img>
                    <span>
                    Create Account <br></br> For Review
                    </span>
                </div>


            </span>


        </div>

        <div>

            <img></img>

        </div>


    </div>

    </React.Fragment>

}

export default Registration_Default_Page;
